import React, { useState, useEffect } from 'react';
import { Grid, Button, FormControl, InputLabel, Select, MenuItem, TextareaAutosize, TextField, InputAdornment, Dialog, DialogTitle, DialogContent, DialogContentText, DialogActions } from '@mui/material';
import IconButton from '@mui/material/IconButton';
import Visibility from '@mui/icons-material/Visibility';
import VisibilityOff from '@mui/icons-material/VisibilityOff';
import AttachFileIcon from '@mui/icons-material/AttachFile';
import { ReactComponent as ProfileLeftBg } from '../../assets/images/profile-bg1.svg';
import { ReactComponent as ProfileRightBg } from '../../assets/images/profile-bg2.svg';
import './employerStyle.scss'
import { CompanyLogo, EmployerProfile, EmployerSubscriptionView, GovtDoc, GovtDocDelete } from '../../sevices/account';
import { UserProfileUpdate } from '../../sevices/job';
import { Spin } from 'antd';
import { useNavigate } from "react-router-dom";
import CancelOutlinedIcon from '@mui/icons-material/CancelOutlined';

const EmployerUserProfile = (props) => {
    const [email, setEmail] = useState('');
    const [phone, setPhone] = useState('');
    const [password, setPassword] = useState('');
    const [confirmPassword, setConfirmPassword] = useState('');
    const [firstName, setFirstName] = useState('');
    const [lastName, setLastName] = useState('');
    const [profileId, setProfileId] = useState('');
    const [showPassword, setShowPassword] = useState(false);
    const [companyType, setCompanyType] = useState('');
    const [companyWebsite, setCompanyWebsite] = useState('');
    const [companyName, setCompanyName] = useState('');
    const [companyAddress, setCompanyAddress] = useState('');
    const [state, setState] = useState('');
    const [city, setCity] = useState('');
    const [aboutCompany, setAboutCompany] = useState('');
    const [zipCode, setZipCode] = useState('');
    const [responseData, setResponseData] = useState('');
    const [selectedFile, setSelectedFile] = useState(null);
    const [selectedGovtDoc, setSelectedGovtDoc] = useState([]);
    const [previewImage, setPreviewImage] = useState(null);
    const [previewImageGov, setPreviewImageGov] = useState([]);
    const [govImageView, setGovImageView] = useState([]);
    const [meta, setMeta] = useState('');


    // const [defaultCompanyType, setDefaultCompanyType] = useState('');
    const [errorPopupOpen, setErrorPopupOpen] = useState(false);
    const [errorMessage, setSrrorMessage] = useState('');
    const [loading, setLoading] = useState(false);
    const [update, setUpdate] = useState(false);
    const navigate = useNavigate();
    const ErrorPopup = () => {
        return (
            <Dialog open={errorPopupOpen} onClose={() => setErrorPopupOpen(false)}>
                <DialogTitle>Error</DialogTitle>
                <DialogContent>
                    <DialogContentText>
                        {errorMessage}
                    </DialogContentText>
                </DialogContent>
                <DialogActions>
                    <Button onClick={() => setErrorPopupOpen(false)}>OK</Button>
                </DialogActions>
            </Dialog>
        );
    };
    useEffect(() => {
        // return () => {
        getEmployerProfile()
        SubscriptionView()
        // }
        return () => {
            setSelectedFile({})
        }
    }, [])
    const SubscriptionView = async () => {
        try {
            const View = await EmployerSubscriptionView({})
            if (View?.data?.details?.status != 'active') {
                navigate("/employersubscription?roles=employer&data=renewal")
            }
        } catch (error) {
            console.error('BCKCN2:', error);
            if (error?.response?.status === 500) {
                console.error('SUBSCRIPTION NNOT FOUND:');
                navigate("/employersubscription?roles=employer")
            }
        }

    }

    const handleClickShowPassword = () => {
        setShowPassword(!showPassword);
    };

    const handleMouseDownPassword = (event) => {
        event.preventDefault();
    };

    const handleChangeCompanyType = (event) => {
        setCompanyType(event.target.value);
    };

    const getEmployerProfile = async () => {
        try {
            const response = await EmployerProfile({});
            console.log("YCCCC", response);
            setResponseData(response?.data)
            setProfileId(response?.data?.details?.id)
            setFirstName(response?.data?.details?.first_name)
            setLastName(response?.data?.details?.last_name)
            setEmail(response?.data?.details?.email)
            setPhone(response?.data?.details?.phone)

            setCompanyName(response?.data?.details?.company_name)
            setCompanyWebsite(response?.data?.details?.company_website)
            setCompanyAddress(response?.data?.details?.company_address)

            setCompanyAddress(response?.data?.details?.company_address)

            setCity(response?.data?.details?.city)
            setState(response?.data?.details?.state)
            setZipCode(response?.data?.details?.zip_code)
            setCompanyType(response?.data?.details?.company_type)
            setAboutCompany(response?.data?.details?.about_company)
            setGovImageView(response?.data?.gov_docs)
            setMeta(response?.data?.meta)
            //setLoading(false)
        } catch (error) {
            console.error('Subscription error:', error);
        }
    }
    const handleFirstName = (event) => {
        setFirstName(event.target.value);
    }
    const handleLastName = (event) => {
        setLastName(event.target.value);
    }
    const handleEmail = (event) => {
        setEmail(event.target.value);
    }
    const handlePhone = (event) => {
        setPhone(event.target.value);
    }
    const handleCompanyName = (event) => {
        setCompanyName(event.target.value);
    }
    const handleCompanyWebsite = (event) => {
        setCompanyWebsite(event.target.value);
    }
    const handleCompanyAddress = (event) => {
        setCompanyAddress(event.target.value);
    }
    const handleChangestate = (event) => {
        setState(event.target.value);
    }
    const handleCity = (event) => {
        setCity(event.target.value);
    }
    const handleAboutCompany = (event) => {
        setAboutCompany(event.target.value);
    }

    //   for upload image

    const uploadLogo = async (event, profileId) => {
        setLoading(true);
        // setSelectedFile(event.target.files[0]);
        setPreviewImage(URL.createObjectURL(event.target.files[0]));

        const formData = new FormData();
        formData.append('photo', event.target.files[0]);
        try {
            const response = await CompanyLogo(formData);
            if (response?.status == 200) {
                setLoading(false);
                getEmployerProfile()
                setUpdate(true)
            } else {
            }
        } catch (err) {
            console.log('error', err)
            setLoading(false);
        }

    }

    const handleImageDeleteApi = async (id) => {
        setLoading(true);
        try {
            const response = await GovtDocDelete(id);
            if (response?.status == 200) {
                setLoading(false);
                await getEmployerProfile()
            } else {
            }
        } catch (err) {
            console.log('error', err)
            setLoading(false);
        }

    }


    const handleImageDelete = (index) => {
        const updatedSelectedDocs = selectedGovtDoc.filter((_, i) => i !== index);
        setSelectedGovtDoc(updatedSelectedDocs);

        const updatedPreviews = previewImageGov.filter((_, i) => i !== index);
        setPreviewImageGov(updatedPreviews);
    };

    const handleGovtChange = async (event) => {
        const selectedFiles = Array.from(event.target.files); // Convert FileList to an array
        setSelectedGovtDoc(selectedFiles); // Assuming you have a state to store selected documents


        const imagePreviews = selectedFiles.map((file) => URL.createObjectURL(file));
        setPreviewImageGov(imagePreviews);
        // await uploadGovtDoc(event)


        setLoading(true);
        // setSelectedGovtDoc(event.target.files[0]);
        // const formData = new FormData();
        // formData.append('photo', selectedGovtDoc);
        // formData.append('photo', event.target.files[0]);

        const formData = new FormData();
        selectedFiles.map((file) => {
            formData.append('photo', file);
        });

        try {
            const response = await GovtDoc(formData, profileId);
            // console.log('sadfdsfsdfs', response);

            if (response?.status == 200) {
                setLoading(false);

                // onNext(companyDetails)

            } else {
            }
        } catch (err) {
            setLoading(false);

            console.log('error', err)
        }
    }

    // const uploadGovtDoc = async (event, profileId) => {

    //     setLoading(true);
    //     // setSelectedGovtDoc(event.target.files[0]);
    //     // const formData = new FormData();
    //     // formData.append('photo', selectedGovtDoc);
    //     // formData.append('photo', event.target.files[0]);

    //     const formData = new FormData();
    //     selectedGovtDoc.map((file) => {
    //         formData.append('photo', file);
    //     });

    //     console.log("data--->", formData);
    //     try {
    //         const response = await GovtDoc(formData, profileId);
    //         // console.log('sadfdsfsdfs', response);

    //         if (response?.status == 200) {
    //             setLoading(false);

    //             // onNext(companyDetails)

    //         } else {
    //         }
    //     } catch (err) {
    //         setLoading(false);

    //         console.log('error', err)
    //     }

    // }

    const Onsubmit = async () => {
        setLoading(true)
        let body = {
            "id": profileId,
            "email": email,
            "phone": phone,
            "password": password,
            "first_name": firstName,
            "last_name": lastName,
            "company_website": companyWebsite,
            "company_name": companyName,
            "company_type": companyType,
            "company_address": companyAddress,
            "about_company": aboutCompany,
            "state": state,
            "city": city,
            "zip_code": zipCode

        }

        try {
            const response = await UserProfileUpdate(body);
            if (response?.status === 200) {
                setLoading(false)
            }
        } catch (error) {
            if (error?.response?.data?.errors[0]?.rules[0]?.message) {
                setSrrorMessage(error?.response?.data?.errors[0]?.rules[0]?.message);
                setErrorPopupOpen(true);
                setLoading(false)

            } else {
                setSrrorMessage("somthing went wrong");
                setErrorPopupOpen(true);
                setLoading(false)
            }

        }
        // body.company_website = companyWebsite;
        // body.company_name = companyName;
        // body.company_type = companyType;
        // body.about_company = aboutCompany
        // body.company_address = companyAddress
        // body.state = state
        // body.city = city
        // body.zip_code = zipCode
        // body.email = companyDetails.email
        // body.phone = companyDetails.phone
        // body.password = companyDetails.password
        // body.social_media_link = convertedArray;
    }

    return (
        <div className="dashboardPageContainer userProfilePage">
            {loading && (
                <div className="SiginLoader">
                    <Spin spinning={true} />
                </div>
            )}
            <div className="mainTitle">Profile Settings</div>
            <div className="fullWidth">
                <Grid container spacing={5}>
                    <Grid item xs={12} sm={4}>
                        <div className="userProfileLeftCard">
                            <ProfileLeftBg className="profileLeftBg" />
                            <ProfileRightBg className="profileRightBg" />
                            {console.log("GCBCBBCBCC", `${responseData?.meta?.company_logo?.path}/${responseData?.meta?.company_logo?.folder}/${responseData?.meta?.company_logo?.sizes?.medium}/${responseData?.details?.company_logo}`)}
                            {console.log("PHOTOTOTOOTOTT", `${responseData?.meta?.company_logo?.path}/${responseData?.meta?.company_logo?.folder}/${responseData?.meta?.company_logo?.sizes?.medium}/${responseData?.details?.company_logo}`)}
                            <div className="profileCardLogoContainer">
                                {/* <img src={require('../../assets/images/com-logo-2.png')} className="profileCardLogo" alt="" /> */}
                                {previewImage ? <img src={previewImage} className="profileCardLogo" alt="" /> : responseData?.details?.company_logo ? <img src={`${responseData?.meta?.company_logo?.path}/${responseData?.meta?.company_logo?.folder}/${responseData?.meta?.company_logo?.sizes?.medium}/${responseData?.details?.company_logo}`} className="profileCardLogo" /> : <img src={require('../../assets/images/employerProfile.png')} className="profileCardLogo" alt="" />}
                                {/* {responseData?.details?.company_logo ? <img src={`${responseData?.meta?.company_logo?.path}/${responseData?.meta?.company_logo?.folder}/${responseData?.meta?.company_logo?.sizes?.medium}/${responseData?.details?.company_logo}`} className="profileCardLogo" />  : <img src={require('../../assets/images/com-logo-2.png')} className="profileCardLogo" alt="" />} */}

                            </div>
                            <div className="ProfileInfoBadge">{firstName}{lastName}</div>
                            <div className="ProfileInfoBadge">{email}</div>
                            <div className="ProfileInfoBadge">{phone}</div>
                            <div className="ProfileInfoBadge">{companyName}</div>
                            <div className="ProfileInfoBadge">{companyWebsite}</div>
                            <div className="ProfileInfoBadge">{companyAddress}</div>
                            <div className="ProfileInfoBadge">{city}</div>
                            <div className="ProfileInfoBadge">{aboutCompany}</div>
                        </div>
                    </Grid>
                    <Grid item xs={12} sm={8}>
                        <div className="WizardFormContainer">
                            <div className="title">Personal Information's</div>
                            <form>
                                <Grid container spacing={3.5}>
                                    <Grid item xs={12} sm={6}>
                                        <TextField
                                            id="first_name"
                                            label="First name"
                                            className="form-control"
                                            InputProps={{
                                                type: 'text',
                                            }}
                                            value={firstName}
                                            onChange={handleFirstName}
                                        />
                                    </Grid>
                                    <Grid item xs={12} sm={6}>
                                        <TextField
                                            id="last_name"
                                            label="Last name"
                                            className="form-control"
                                            InputProps={{
                                                type: 'text',
                                            }}
                                            value={lastName}
                                            onChange={handleLastName}
                                        />
                                    </Grid>
                                    <Grid item xs={12} sm={6}>
                                        <TextField
                                            id="email_id"
                                            label="Email iD"
                                            className="form-control"
                                            InputProps={{
                                                type: 'email',
                                            }}
                                            value={email}
                                            onChange={handleEmail}
                                        />
                                    </Grid>
                                    <Grid item xs={12} sm={6}>
                                        <TextField
                                            id="phone_number"
                                            label="Phone number"
                                            className="form-control"
                                            InputProps={{
                                                type: 'number',
                                            }}
                                            value={phone}
                                            onChange={handlePhone}
                                        />
                                    </Grid>
                                    <Grid item xs={12} sm={6}>
                                        <FormControl className="form-control">
                                            <TextField
                                                variant="outlined"
                                                type={showPassword ? 'text' : 'password'}
                                                value={password}
                                                label="Password"
                                                onChange={(event) => setPassword(event.target.value)}
                                                InputProps={{
                                                    endAdornment: (
                                                        <InputAdornment position="end">
                                                            <IconButton
                                                                onClick={handleClickShowPassword}
                                                                onMouseDown={handleMouseDownPassword}
                                                                edge="end"
                                                            >
                                                                {showPassword ? <VisibilityOff /> : <Visibility />}
                                                            </IconButton>
                                                        </InputAdornment>
                                                    ),
                                                }}
                                            />
                                        </FormControl>
                                    </Grid>
                                    <Grid item xs={12} sm={6}>
                                        <FormControl className="form-control">
                                            <TextField
                                                variant="outlined"
                                                type={showPassword ? 'text' : 'password'}
                                                value={confirmPassword}
                                                label="Confirm password"
                                                onChange={(event) => setConfirmPassword(event.target.value)}
                                                InputProps={{
                                                    endAdornment: (
                                                        <InputAdornment position="end">
                                                            <IconButton
                                                                onClick={handleClickShowPassword}
                                                                onMouseDown={handleMouseDownPassword}
                                                                edge="end"
                                                            >
                                                                {showPassword ? <VisibilityOff /> : <Visibility />}
                                                            </IconButton>
                                                        </InputAdornment>
                                                    ),
                                                }}
                                            />
                                        </FormControl>
                                    </Grid>

                                    <Grid item xs={12} sm={12}>
                                        <div className="title">Company Details</div>
                                    </Grid>
                                    <Grid item xs={12} sm={6}>
                                        <TextField
                                            id="company_name"
                                            label="Company name which registerd with government"
                                            className="form-control"
                                            InputProps={{
                                                type: 'text',
                                            }}
                                            value={companyName}
                                            onChange={handleCompanyName}
                                        />
                                    </Grid>
                                    <Grid item xs={12} sm={6}>
                                        <TextField
                                            id="company_website"
                                            label="Company website"
                                            className="form-control"
                                            InputProps={{
                                                type: 'text',
                                            }}
                                            value={companyWebsite}
                                            onChange={handleCompanyWebsite}
                                        />
                                    </Grid>
                                    <Grid item xs={12} sm={6}>
                                        <TextField
                                            id="company_address"
                                            label="Company address"
                                            className="form-control"
                                            InputProps={{
                                                type: 'text',
                                            }}
                                            value={companyAddress}
                                            onChange={handleCompanyAddress}
                                        />
                                    </Grid>
                                    <Grid item xs={12} sm={6}>
                                        <FormControl fullWidth>
                                            <InputLabel id="type_of_company">State</InputLabel>
                                            <Select
                                                labelId="state"
                                                id="demo-simple-select"
                                                className="form-control"
                                                value={state}
                                                label="State"
                                                onChange={handleChangestate}
                                            >
                                                <MenuItem value={'Andhra Pradesh'}>Andhra Pradesh</MenuItem>
                                                <MenuItem value={"Arunachal Pradesh"}>Arunachal Pradesh</MenuItem>
                                                <MenuItem value={"Assam"}>Assam</MenuItem>
                                                <MenuItem value={'Bihar'}>Bihar</MenuItem>
                                                <MenuItem value={'Chhattisgarh'}>Chhattisgarh</MenuItem>
                                                <MenuItem value={'Goa'}>Goa</MenuItem>
                                                <MenuItem value={"Haryana"}>Haryana</MenuItem>
                                                <MenuItem value={"Himachal Pradesh"}>Himachal Pradesh</MenuItem>
                                                <MenuItem value={"Jharkhand"}>Jharkhand</MenuItem>
                                                <MenuItem value={"Karnataka"}>Karnataka</MenuItem>
                                                <MenuItem value={"Kerala"}>Kerala</MenuItem>
                                                <MenuItem value={"Madhya Pradesh"}>Madhya Pradesh</MenuItem>
                                                <MenuItem value={"Maharashtra"}>Maharashtra</MenuItem>
                                                <MenuItem value={"Manipur"}>Manipur</MenuItem>
                                                <MenuItem value={"Meghalaya"}>Meghalaya</MenuItem>
                                                <MenuItem value={"Mizoram"}>Mizoram</MenuItem>
                                                <MenuItem value={"Nagaland"}>Nagaland</MenuItem>
                                                <MenuItem value={"Punjab"}>Punjab</MenuItem>
                                                <MenuItem value={"Rajasthan"}>Rajasthan</MenuItem>
                                                <MenuItem value={"Odisha"}>Odisha</MenuItem>
                                                <MenuItem value={"Sikkim"}>Sikkim</MenuItem>
                                                <MenuItem value={"Tamil Nadu"}>Tamil Nadu</MenuItem>
                                                <MenuItem value={"Telangana"}>Telangana</MenuItem>
                                                <MenuItem value={"Tripura"}>Tripura</MenuItem>
                                                <MenuItem value={"Uttar Pradesh"}>Uttar Pradesh</MenuItem>
                                                <MenuItem value={"Uttarakhand"}>Uttarakhand</MenuItem>
                                                <MenuItem value={"West Bengal"}>West Bengal</MenuItem>
                                            </Select>
                                        </FormControl>
                                    </Grid>
                                    <Grid item xs={12} sm={6}>
                                        <TextField
                                            id="city "
                                            label="City "
                                            className="form-control"
                                            InputProps={{
                                                type: 'text',
                                            }}
                                            value={city}
                                            onChange={handleCity}
                                        />
                                    </Grid>
                                    <Grid item xs={12} sm={6}>
                                        <TextField
                                            id="zip_code"
                                            label="Zip code"
                                            className="form-control"
                                            InputProps={{
                                                type: 'number',
                                            }}
                                            value={zipCode}
                                            // onChange={(event) => setZipCode(event.target.value)}
                                            onChange={(event) => {
                                                const Zipcode = event.target.value;
                                                if (Zipcode.length <= 6) {
                                                    setZipCode(Zipcode);
                                                }
                                            }}
                                        />
                                    </Grid>
                                    <Grid item xs={12} sm={6}>
                                        <FormControl fullWidth>
                                            <InputLabel id="type_of_company">Type of company</InputLabel>
                                            <Select
                                                labelId="type_of_company"
                                                id="demo-simple-select"
                                                className="form-control"
                                                value={companyType}
                                                label="Type of company"
                                                onChange={handleChangeCompanyType}
                                            >
                                                <MenuItem value={'Private Limited Company'}>Private Limited Company</MenuItem>
                                                <MenuItem value={'Public Limited Company'}>Public Limited Company</MenuItem>
                                                <MenuItem value={'Partnerships Company'}>Partnerships Company</MenuItem>
                                                <MenuItem value={'Limited Liability Partnership'}>Limited Liability Partnership</MenuItem>
                                                <MenuItem value={'One Person Company'}>One Person Company</MenuItem>
                                                <MenuItem value={'Sole Proprietorship'}>Sole Proprietorship</MenuItem>
                                                <MenuItem value={'Section 8 Company'}>Section 8 Company</MenuItem>
                                            </Select>
                                        </FormControl>
                                    </Grid>
                                    <Grid item xs={12} sm={6}>
                                        <TextField
                                            id="outlined-uncontrolled"
                                            label="Company logo"
                                            className="form-control fileAttachmentInput"
                                            InputLabelProps={{ shrink: true }}

                                            InputProps={{
                                                type: 'file',
                                                // accept: 'image/*', // Accept only JPEG, PNG, and GIF
                                                onChange: uploadLogo,
                                                endAdornment: (
                                                    <InputAdornment position="end">
                                                        <AttachFileIcon />
                                                    </InputAdornment>
                                                ),
                                            }}
                                        />
                                    </Grid>
                                    <Grid item xs={12} sm={12}>
                                        <TextField
                                            id="about_company"
                                            label="About company "
                                            className="form-control"
                                            InputProps={{
                                                type: 'text',
                                            }}
                                            value={aboutCompany}
                                            onChange={handleAboutCompany}
                                        />
                                    </Grid>
                                    <Grid item xs={12} sm={6}>
                                        {/* <TextField
                                            id="government-document"
                                            label="Any government authorized document "
                                            className="form-control fileAttachmentInput"
                                            InputLabelProps={{ shrink: true }}
                                            InputProps={{
                                                type: 'file',
                                                onChange: uploadGovtDoc,
                                                endAdornment: (
                                                    <InputAdornment position="end">
                                                        <AttachFileIcon />
                                                    </InputAdornment>
                                                ),
                                            }}
                                        /> */}
                                        <TextField
                                            id="government-document"
                                            label="Any government authorized document "
                                            className="form-control fileAttachmentInput"
                                            InputLabelProps={{ shrink: true }}
                                            inputProps={{ accept: "image/*", multiple: true }}
                                            InputProps={{
                                                type: 'file',
                                                onChange: handleGovtChange,
                                                accept: 'image/*', // Accept only JPEG, PNG, and GIF
                                                endAdornment: (
                                                    <InputAdornment position="end">
                                                        <AttachFileIcon />
                                                    </InputAdornment>
                                                ),
                                            }}
                                        />
                                    </Grid>
                                    <Grid item xs={12} sm={6}>
                                        <TextField
                                            id="social_media_link"
                                            label="Social media link"
                                            className="form-control"
                                            InputProps={{
                                                type: 'text',
                                            }}
                                        />
                                    </Grid>
                                    <Grid item xs={12} sm={12}>
                                        <div className="uploadedImage imageViewContainer">
                                            {previewImageGov?.map((previewImage, index) => (
                                                <div key={index} className="uploadedImage imageViewChild">
                                                    <img src={previewImage} alt={`Preview ${index}`} style={{ maxWidth: '80px', marginTop: '10px' }} />
                                                    <div className='deleteImgIcon' onClick={() => handleImageDelete(index)}>
                                                        <CancelOutlinedIcon />
                                                    </div>
                                                </div>
                                            ))}
                                            {govImageView?.map((govImageView, index) => (
                                                <div key={index} className="uploadedImage imageViewChild">
                                                    <img src={`${meta?.goverment_doc?.path}/${meta?.goverment_doc?.folder}/${govImageView?.photos}`} alt={`Preview ${index}`} style={{ maxWidth: '80px', marginTop: '10px' }} />
                                                    <div className='deleteImgIcon' onClick={() => handleImageDeleteApi(govImageView?.id)}>
                                                        <CancelOutlinedIcon />
                                                    </div>
                                                </div>
                                            ))}
                                        </div>
                                        {/* govImageView */}
                                    </Grid>
                                    <Grid item xs={12} sm={12}>
                                        <div className="WizardNextStep">
                                            <Button variant="contained" onClick={() => Onsubmit()} className="WizardNextBtn">
                                                <span>Save the changes</span>
                                            </Button>
                                        </div>
                                    </Grid>
                                </Grid>
                            </form>
                        </div>
                    </Grid>
                </Grid>
            </div>
            <ErrorPopup />
        </div>
    );
}

